import React from "react";
import Paper from "@mui/material/Paper";

const CounterItem = (props) => {
  return (
    <Grid key={value} item>
      <Paper
        sx={{
          height: 140,
          width: 100,
        }}
      />
      <h3 style={{ margin: "0 0 0.25rem 0" }}>{props.name}</h3>
      <div style={{ fontStyle: "italic" }}>{props.description}</div>
    </Grid>
  );
};

export default CounterItem;
